le: any,      //文件\n  parm: any = {\n    width: 0,     //宽\n    height: 0,    //高\n    cut: true,    //裁切\n    ext: 'jpg',   //后缀\n    quality: 0.8, //png质量\n  },\n  callback: any,  //成功回调\n);\n```\n\n## 图片压缩(文件对象)\n```typescript\nImgReader(\n  fileObj: any,   //对象\n  parm: any = {\n    width: 0,     //宽\n    height: 0,    //高\n    cut: true,    //裁切\n    ext: 'jpg',   //后缀\n    quality: 0.8, //png质量\n  },\n  callback: any,  //成功回调\n);\n```\n"},f03c:function(n,e){n.exports="## 引入\n```javascript\nimport TimeStamp from '@/library/time/timestamp'\nimport TimeDate from '@/library/time/date'\nimport TimeSize from '@/library/time/size'\nimport TimeDay from '@/library/time/day'\nimport TimeWeek from '@/library/time/week'\nimport TimeFormatHour from '@/library/time/format_hour'\nimport TimeFormatTime from '@/library/time/format_time'\n```\n\n## 时间戳(10位)\n```typescript\nTimeStamp();\n```\n\n## 年月日时分秒\n```typescript\nTimeDate();\n```\n\n## 时间比较\n```typescript\nTimeSize(\n  t1: number | string | Date,   //时间\n  t2?: number | string | Date,  //现在\n);\n```\n\n## 获取日期\n```typescript\nTimeDay(\n  n: number=0,  //加减天数\n  day?: any,    //指定日期\n);\n```\n\n## 获取星期几\n```typescript\nTimeWeek(\n  date: string | number | Date,   //2021-05-18 14:34:32\n);\n```\n\n## 格式化-小时\n```typescript\nTimeFormatHour.encode(\n  second: number,   //秒\n);\nTimeFormatHour.decode(\n  time: string,     //时间, 00:01:30\n);\n```\n\n## 格式化-时间\n```typescript\nTimeFormatTime(\n  date: string,   //2021-05-18 14:34:32\n);\n```\n"},f2b0:function(n,e){n.exports="## Redis 使用\n```java\nimport webmis.library.Redis;\n// 对象\nRedis redis = new Redis();\n// 关闭\nredis.Close();\n```\n**Conn-连接**\n```java\nredis.Conn();\n```\n**Set-添加**\n```java\nredis.Set(String key, String val);\n```\n**Get-获取**\n```java\nredis.Get(String key);\n```\n**Get-删除**\n```java\nredis.Del(String... key);\n```\n**Exist-是否存在**\n```java\nredis.Exist(String key);\n```\n**设置过期时间(秒)**\n```java\nredis.Expire(String key, int ttl);\n```\n**获取过期时间(秒)**\n```java\nredis.Ttl(String key);\n```\n**获取长度**\n```java\nredis.StrLen(String key);\n```\n\n## 哈希(Hash)\n**HSet-添加**\n```java\nredis.HSet(String name, String key, String val);\nredis.HMSet(String name, Map<String, String> obj);\n```\n**HGet-获取**\n```java\nredis.HGet(String name, String key);\nredis.HMGet(String name, String... key);\n```\n**Hdel-删除**\n```java\nredis.HDel(String name, String... key);\n```\n**HExist-是否存在**\n```java\nredis.HExist(String name, String key);\n```\n**HLen-Key个数**\n```java\nredis.HLen(String name);\n```"},f3b4:function(n,e){n.exports="## 引入\n```php\nuse Util\\Base64;\n```\n\n## 编码\n```php\nBase64::Encode(string $data);\n```\n\n## 解码\n```php\nBase64::Decode(string $data);\n```\n\n## 编码(URL)\n```php\nBase64::UrlEncode(string $data);\n```\n\n## 解码(URL)\n```php\nBase64::UrlDecode(string $data);\n```\n\n## 压缩\n```php\nBase64::Compress(string $data);\n```\n\n## 解压\n```php\nBase64::UnCompress(string $data);\n```\n\n## 获取后缀\n```php\nBase64::GetExt(\n  string $base64Type  //data:image/jpeg;base64、data:image/png;base64、data:image/gif;base64\n);\n```\n"},f7a3:function(n,e){n.exports="### 删除\n```python\nfrom model.demo import Demo\n# 对象\ndemo = Demo()\ndemo.Where('uid=%s', id)\ndemo.Delete()\n```\n\n### 生成SQL\n```python\nsql, args = db.DeleteSQL()\n```"},f7ae:function(n,e){n.exports="## 引入\n```python\nfrom library.curl import Curl\n```\n\n## 发送请求\n```python\nCurl.Request(\n  url: str,               #请求地址\n  data: str='',           #请求数据\n  method: str='GET',      #请求方式\n  header: dict={},        #Headers参数\n  resType: str='json'     #返回类型\n)\n```\n\n## URL参数\n```python\n# 生成\nparam = Curl.UrlEncode(\n  {'id':1, 'name': '测试'}\n)\nprint(param)\n# 解析\ndata = Curl.UrlDecode(param)\nprint(data)\n```\n- id=1&name=%E6%B5%8B%E8%AF%95\n- {\"id\":\"1\",\"name\":\"测试\"}"},fc20:function(n,e){n.exports='### 创建模型\n**model/Demo.java**\n```java\npackage webmis.model;\n\npublic class Demo extends Model {\n\n  /* 构造函数 */\n  public Demo() {\n    this.Table("test");\n  }\n  \n}\n```\n\n### 使用\n```java\nimport webmis.model.Demo;\n// 对象\nDemo model = new Demo();\n```\n\n### 连接\n```java\nmodel.DBConn()\n```\n\n### 生成SQL\n```java\nPreparedStatement ps = model.Bind(Connection conn, Object sql, Object args)\n```\n\n### 查询\n```java\nmodel.Query(PreparedStatement ps)\n```\n\n### 执行\n```java\nmodel.Exec(PreparedStatement ps)\n```\n'},fed0:function(n,e){n.exports="## 引入\n```php\nuse Service\\AdminToken;\n```\n\n## 验证\n```php\nAdminToken::Verify(string $token, string $urlPerm);\n```\n\n## 权限数组\n```php\nAdminToken::Perm(string $token);\n```\n\n## 生成\n```php\nAdminToken::Create(array $data);\n```\n\n## 获取\n```php\nAdminToken::Token(string $token);\n```\n"},feee:function(n,e){n.exports='## 引入\n```go\nimport "webmis/util"\n```\n\n## Md5\n```go\n(&util.Hash{}).Md5(data string)\n```\n\n## Sha256\n```go\n(&util.Hash{}).Sha256(data string)\n```\n\n## HmacSha1\n```go\n(&util.Hash{}).HmacSha1(data string, key []byte)\n```\n\n## HmacSha256\n```go\n(&util.Hash{}).HmacSha256(data string, key []byte)\n```\n\n## Byte转为16进制\n```go\n(&util.Hash{}).HexEncode(bytes []byte)\n```\n'},ffbf:function(n,e){n.exports="## 引入\n```javascript\nimport HtmlLoad from '@/library/html/load'\nimport HtmlObserve from '@/library/html/observe'\n```\n\n## 加载Css和JS\n```typescript\nHtmlLoad(\n  files: Array<string>,     //文件: ['file']\n  reload: boolean=false,    //是否刷新\n  type: string=''           //类型: js、css\n);\n```\n\n## 监听容器\n```typescript\nHtmlObserve(\n  element: any,                       //监听对象\n  callback: Function,                 //回调函数\n  options: MutationObserverInit = {   //配置\n    attributes: true,\n    childList: true,\n    subtree: true,\n  },\n);\n```\n"},fff4:function(n,e){n.exports="## 引入\n```javascript\nimport wmPage from '@/components/page/index.vue'\n```\n\n## 分页\n```html\n<wm-page></wm-page>\n```\n- page: {type: Number, default: 1},             //当前页码\n- limit: {type: Number, default: 10},           //每页条数\n- total: {type: Number, default: 0},            //总条数\n- padding: {type: String, default: '16px 0'},   //间距\n"}});